const Card = props => {
  return (
    <div className="card">
        <h1 className="company-name"> Company name</h1>
        <img className="chip-phone" />
        <h1 className="card-number"> 1351254895622222222</h1>
        <div className="card-superposition">
          <div>
            <h1 className="valid-thru"> 12/80</h1>
            <h1 className="card-holder"> FOULEN</h1>
          </div>
          <div>
          <img className="mastercard" src='https://seeklogo.net/wp-content/uploads/2016/07/mastercard-vector-logo.png' />
          </div>
        </div>
      </div>
  );
};

export default Card;
